const count = function (root) {
  if (root == null) {
    return 0;
  }
  // \u6211\u8FD9\u4E2A\u8282\u70B9\u5173\u5FC3\u7684\u662F\u6211\u7684\u4E24\u4E2A\u5B50\u6811\u7684\u8282\u70B9\u603B\u6570\u5206\u522B\u662F\u591A\u5C11
  const leftCount = count(root.left);
  const rightCount = count(root.right);
  // \u540E\u5E8F\u4F4D\u7F6E\uFF0C\u5DE6\u53F3\u5B50\u6811\u8282\u70B9\u6570\u52A0\u4E0A\u81EA\u5DF1\u5C31\u662F\u6574\u68F5\u6811\u7684\u8282\u70B9\u6570
  return leftCount + rightCount + 1;
};
